import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter> 
                <Routes>    
                    <Route path="/" element={<App />}> 
                        <Route index element={<App />} />
                        <Route path="User_page" element={<UserScreen />} />
                    </Route>
                </Routes>
      </BrowserRouter>
  </React.StrictMode>
);


reportWebVitals();
